import React from 'react';

const Result = ({ song }) => {
    results && results.length > 0 && results.map((song, id) => {

        return(
            <div key={id} className="search-result"
                    onClick={() => this.addSong(song)}>

                <img src={song.album.images[0].url} alt="song" />
                <h5>{song.name} by {song.artists[0].name}</h5>

            </div>
        )
    })
}

export default Result;
